import React from "react";
import BotCard from "./BotCard";

const BotArmy = ({ army, releaseBot, addBotToArmy }) => (
    <div>
        {army.map(bot => <BotCard key={bot.id} bot={bot} selectBot={releaseBot} addBotToArmy={addBotToArmy} />)}
    </div>
);

export default BotArmy;
